  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Medicine Lake
  NWR outlines Refuge accomplishments from May through August of 1944. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include grazing, haying, and fur harvesting. The
  public relations section of the report describes recreational uses, Refuge visitors,
  and fishing. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
